import Head from 'next/head'
import Layout from '../components/layout';
import { siteTitle } from '../components/head-metadata';
import utilStyles from '../styles/utils.module.css';

const Home = () => (
    <Layout home>
        <Head>

        </Head>
        <section className={utilStyles.headingMd}>
            <p>
                "a game about trying to AGH!!! WHO TURNED OFF THE LIGHTS IN HERE?! okay 
                that’s better. let me try that again... a game about trying to find what’s
                been wreaking havoc on our dungeon, where the only way out is in!"
                 - Ids
            </p>
        </section>
    </Layout>  
);

export default Home;
